    navigator.geolocation.getCurrentPosition(showPosition);
  } else { 
    return null;
  }
}

function showPosition(position) {
  const a =  "Latitude: " + position.coords.latitude + "<br>Longitude: " + position.coords.longitude;
  return a;
}


